import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      weather: [2, 3, 4],
      number: 0,
    }; // end constructor
  }

  componentDidMount() {
    // Fetch Function Goes here

    const a = [1, 2, 3];
    console.log(this.setState.weather);
    this.setState({ weather: a });
  }

  changeDescription = () => {
    const a = [12, 13, 15];
    this.setState({ number: this.state.number + 1 });
  };

  render() {
    return (
      <div className="App">
        <input type="text" />
        <button onClick={this.changeDescription}> Search</button>
        {this.state.number}
        {console.log(this.state.weather)}
      </div>
    );
  }
} // End Class

export default App;
